import React, { Component } from "react";
import { userVisitHistory } from "../HTTPRequests";
import shortVisitComponent from "./ShortVisitComponent";
import ReactList from "react-list";

class VisitHistory extends Component {
  constructor(props) {
    super(props);
    this.state = {
      visitas: ["Pedro", "Manel", "Peter"],
    };

    this.renderItem = this.renderItem.bind(this);
  }

  renderItem(index, key) {
    return (
      <div key={key}>
        {<shortVisitComponent visited={this.state.visitas[index]} />}
      </div>
    );
  }

  render() {
    return (
      <div style={{ width: "600px", height: "650px", overflowY: "scroll" }}>
        <ReactList
          itemRenderer={this.renderItem}
          length={this.state.visitas.length}
          type="uniform"
        />
      </div>
    );
  }
}

export default VisitHistory;
